// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract PieMessage {

  event Completed(address indexed sender, address[] indexed receivers, string indexed payload);

  function record(address[] memory receivers, string memory payload) public returns (bool){
    emit Completed(msg.sender, receivers, payload);
    return true;
  }

}
